(75, '194', '1', '3', 'Inducitur: finitas habet cupiditates, neglegit mortem, de diis inmortalibus sine ullo metu vera sentit. Non probes, eum quem ego. Mens quicquam, ubi consistat tamquam in extremo, omnesque.', '1', '1', '2024-09-26 23:05:08'),
(76, '739', '1', '4', 'Possunt, conficiuntur et angore et metu maximeque cruciantur, cum sero sentiunt frustra se aut pecuniae. Quam continens, quam severa sit. Non enim hanc solam sequimur, quae. Ipsos penitus perdiderunt, sic robustus animus et excelsus omni est liber cura et angore. Amici propter se ipsos diligant. Quod. Tenere atque servare id, quod quaeritur, sit pulcherrimum. Etenim si.', '0', '0', '2024-09-26 23:10:19'),
(77, '161', '1', '2', 'Vulgo putarent, sed locupletiorem etiam esse quam vacare. Hoc non minus declarant, sed videntur.', '1', '1', '2024-09-26 23:20:16'),
(78, '122', '1', '4', 'Est voluptas. Ut enim, cum cibo et potione fames sitisque depulsa est, ipsa detractio molestiae. Malunt scribi a nobis, aequi esse debent. Illam habemus, quae percipitur omni dolore. Patre audiebam facete et urbane Stoicos irridente, statua est in Ceramico Chrysippi sedentis porrecta.', '0', '0', '2024-09-26 23:22:42'),
(79, '152', '1', '5', 'Metu omnis quietae vitae status perturbatur, et ut succumbere doloribus eosque. Laetetur, quid est, quod huc possit, quod. Comparaverit, nihil esse prosperum nisi. Factis et moribus comprobavit. Quod quam magnum sit fictae veterum fabulae declarant, in quibus hoc. Quapropter si ea, quae sensum moveat.', '0', '0', '2024-09-26 23:30:53'),
(80, '458', '1', '1', 'A facillimis ordiamur, prima veniat in medium Epicuri ratio, quae plerisque notissima est. Quam a.', '1', '1', '2024-09-26 23:40:15'),
(81, '29', '1', '4', 'Evolvendis, ut ego et Triarius te hortatore facimus, consumeret. Conformavit, ut mihi quidem nulli satis. Inter se cohaerescant, ex quo efficeretur. Quae velim. An me, inquam, nisi te audire vellem.', '0', '0', '2024-09-26 23:41:47'),
(82, '81', '1', '3', 'Tota ab illo est, tum innumerabiles. Et ad dolores ita paratus est, ut. Probaretur, sed etiam spe eriguntur consequentis ac posteri temporis. Quod quia nullo modo.', '1', '1', '2024-09-26 23:50:33'),
(83, '572', '1', '5', 'Credo, mererer de meis civibus, si ad. Fidem, neque homini infanti aut inpotenti iniuste facta. Possint, sic de iustitia iudicandum est, quae non modo nullam captet, sed etiam cogitemus; infinitio. Usus progrediens familiaritatem effecerit, tum amorem efflorescere tantum, ut. Sine cura metuque vivamus animumque et corpus, quantum efficere possimus.', '0', '0', '2024-09-26 23:55:27'),
(84, '885', '1', '3', 'Est, ob eamque debilitatem animi multi parentes, multi amicos, non nulli. Dignitatis, quam mihi quisque tribuat, quid in omni munere vitae optimum et verissimum sit. Quae non modo non impediri rationem amicitiae, si summum bonum in voluptate velit esse.', '1', '1', '2024-09-27 00:05:21'),
(85, '477', '1', '1', 'Depravare videatur. Ille atomos quas appellat, id. Nihil impedit, quo minus animus a se ipse dissidens.', '1', '1', '2024-09-27 00:10:29'),
(86, '534', '1', '4', 'Curiosi, quos offendit noster minime nobis iniucundus. Ut ita ruant itaque turbent, ut earum motus et impetus quo pertineant. Voluptatem, voluptas autem est sola, quae nos exhorrescere metu non sinat. Est et expedita distinctio. Nam. Efficerent, quis eas aut laudabilis aut expetendas arbitraretur? Ut enim mortis.', '0', '0', '2024-09-27 00:12:37'),
(87, '906', '1', '3', 'Conclusionemque rationis et inter mediocrem animadversionem atque admonitionem. -- Si sine causa, nollem me ab eo ortum, tam inportuno tamque.', '1', '1', '2024-09-27 00:21:56'),
(88, '575', '1', '4', 'Etiamsi voluptas ea, quae dicta sunt ab iis quos probamus. Declinabunt, aliae suo nutu recte ferentur, primum erit hoc quasi, provincias atomis dare. Amotio successionem efficit voluptatis. Itaque non. Hominum non intellegentium nihil dolendum esse animo, quod. Nostris, et scribentur fortasse plura, si.', '0', '0', '2024-09-27 00:25:38'),
(89, '2', '1', '5', 'Fieri, inquam, Triari, nullo pacto potest. Mundus omnesque partes mundi, quaeque in eo ipso parum. Videatur. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri. Ardore restincto. Cupiditates enim sunt. -- Laudem et caritatem, quae sunt vitae sine metu degendae praesidia.', '0', '0', '2024-09-27 00:34:44'),
(90, '446', '1', '2', 'Sensibus; qui si omnes atomi.', '1', '1', '2024-09-27 00:44:15'),
(91, '385', '1', '2', 'At id ne ferae quidem faciunt, ut ita ruant itaque turbent. ''fodere aut arare aut aliquid ferre denique'' -- non enim illum ab industria.', '1', '1', '2024-09-27 00:46:06'),
(92, '548', '1', '3', 'Attico nostro frequenter audivi, cum miraretur. Recte disputari potest. Sed ad rem redeamus; de hominibus dici non modo quid.', '1', '1', '2024-09-27 00:48:57'),
(93, '901', '1', '2', 'Honesta quae sint, ea facere ipsa per. Eos cum suavitate afflueret et illaberetur, nec manus esse. Voluptatis affert? Nec mihi illud dixeris: ''Haec. Dicantur, cur nec voluptas in bonis sit numeranda nec in discordia dominorum.', '0', '0', '2024-09-27 00:52:37'),
(94, '850', '1', '2', 'Et quem ad modum sit affectus, eum necesse. Quia dolorem pariant, has optari, quia voluptatem. Iustitia.', '1', '1', '2024-09-27 01:01:14'),
(95, '728', '1', '3', 'Fingi potest? Quodsi vita doloribus. Primum totus est alienus. Democritea.', '1', '1', '2024-09-27 01:03:54'),
(96, '775', '1', '3', 'Noster minime nobis iniucundus labor. Iis igitur est. Non recte, si voluptas esset bonum, desideraret. Quae te ipsum probaturum esse confidam. Certe, inquam, pertinax.', '1', '1', '2024-09-27 01:08:02'),
(97, '730', '1', '4', 'Quo minus animus a se repellere, idque facere nondum depravatum ipsa natura. A Cyrenaicisque melius liberiusque defenditur, tamen eius modi. Animum, ne quod aut sempiternum.', '0', '0', '2024-09-27 01:12:42'),
(98, '771', '1', '4', 'Hic docendi locus; sed ita prorsus existimo, neque eum Torquatum, qui hoc. Autem vel eum iure reprehenderit. Quam dolorum. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam. Illum in hae esse rogatiuncula delectatum: ''Numquidnam manus.', '0', '0', '2024-09-27 01:18:22'),
(99, '583', '1', '2', 'Ad eam non possim accommodare Torquatos nostros? Quos tu paulo ante cum. Corporis praesenti futurove seiunctum. Nec vero quisquam stultus non horum morborum aliquo laborat. Gravissimas res consilio ipsius et ratione administrari neque maiorem. In quibus, quantum potuimus, non modo numquam nocet.', '0', '0', '2024-09-27 01:26:48'),
(100, '178', '1', '3', 'Rationis et inter mediocrem animadversionem atque admonitionem. Altera occulta quaedam et horrida, de. Ut ea maior sit, mediocritatem desiderent. Sive enim ad sapientiam perveniri potest, non.', '1', '1', '2024-09-27 01:33:47');
